query:
/*+ NoHashJoin(t mc) NoNestLoop(mc t mi_idx) */ select count(*)
from title AS t
inner join movie_companies AS mc
on t.id = mc.movie_id AND t.kind_id = 1 AND t.production_year < 2006 AND mc.company_id < 34 AND mc.company_type_id = 1
inner join movie_info_idx AS mi_idx
on t.id = mi_idx.movie_id;
